import { useState } from 'react';
import Head from 'next/head'
import styled from 'styled-components';
import { Select } from '@zeit-ui/react'
import { AiOutlineShopping } from "react-icons/ai";


export const HeaderWrapper = styled.div`

padding:0% 4% 0% 4%;
width:100vw;
height:14vh;
background:#ea1b37;
display:grid;
grid-template-rows:30% 70%;
align-items:center;
`;
export const LogoWrapper = styled.img`
margin:0;
max-width:13vw;
`;
export const MenuWrapper = styled.div`
  display:flex;
  justify-content:space-around;
`;
export const ATag = styled.a`
color:#faf4f4;
font-weight:500;
font-size:0.9rem;
font-family:'Roboto',sans-serif;
&:hover{
    color:#bcbcbc;
}
`;
export const CarritoWrapper = styled.div`
  
`;
export const AuthWrapper = styled.div`
  display:flex;
  justify-content:space-around;
`;
export const TopHeader = styled.div`
  display: grid;
  grid-template-columns:80% 20%;
`;
export const BottomHeader = styled.div`
  display:grid;
  align-items:center;
  grid-template-columns:25% 55% 20%;
`;
 
const Header = () => {
 
    return (
        <HeaderWrapper>
            <TopHeader>
                <div>
                </div>
                <div>
                <CarritoWrapper>
                    <AiOutlineShopping size="25px" color="#f1f1f1"/>
                </CarritoWrapper>
                <AuthWrapper>
                    <ATag> Ingresar</ATag>
                    <ATag> Registrarse</ATag>
                </AuthWrapper>
                </div>
            </TopHeader>
            <BottomHeader>
                <LogoWrapper src="/logo.png" />
                <MenuWrapper> 
                    <ATag href="#!"> Inicio </ATag>
                    <ATag href="#!"> Que hacer </ATag>
                    <ATag href="#!">Reserv√°</ATag>
                    <ATag href="#!">Descubrila </ATag>
                    <ATag href="#!">Informaci√≥n </ATag>
                    <ATag href="#!">Contacto </ATag>
                </MenuWrapper>
            </BottomHeader>
        </HeaderWrapper>
      );
}
 
export default Header;
